export default Object.freeze({
    MAIN: "main",                                           // [개인회원, 기업회원] 메인
    AdminMain: "adminMain",                                 // [서비스관리자, 인프라관리자] 메인
    JobMenu: "jobMenu",                                     // [공통] 풀 스크린 메뉴
    JobApplicationStatus: "jobApplicationStatus",           // [개인회원] 지원 현황
    EducationStatus: "educationStatus",                     // [개인회원] 교육 현황
    ResumePage: "resumePage",                               // [개인회원] 이력서
    IndividualUserProfile: "individualUserProfile",         // [개인회원] 개인 정보
    WooriboundElevationInfo: "wooriboundElevationInfo",     // [개인회원] 우바 고도
    EducationApplication: "educationApplication",           // [개인회원] 교육 신청
    CareerRevive: "careerRevive",                           // [개인회원] 경력 살리기
    NewJobSearch: "newJobSearch",                           // [개인회원] 새로운 일 찾기
    AllJobListings: "allJobListings",                       // [개인회원] 전체 조회
    LoginView: "loginView",                                 // [개인회원, 기업회원] 로그인
    CorporateUserRegisterView: "corporateUserRegisterView", // [개인회원] 원가입
})

// src/constants/routes.js
export const ROUTES = {
    MAIN: {
        path: "/",
        name: "Main",
    },
    ADMIN_MAIN: {
        path: "/admin",
        name: "AdminMain",
    },
    JOB_MENU: {
        path: "/jobs/menu",
        name: "JobMenu",
    },
    JOB_APPLICATION_STATUS: {
        path: "/jobs/application-status",
        name: "JobApplicationStatus",
    },
    EDUCATION_STATUS: {
        path: "/education-status",
        name: "EducationStatus",
    },
    RESUME_PAGE: {
        path: "/resume",
        name: "ResumePage",
    },
    INDIVIDUAL_USER_PROFILE: {
        path: "/individual-user/profile",
        name: "IndividualUserProfile",
    },
    LOGIN_VIEW: {
        path: "/login",
        name: "LoginView",
    },
    INDIVIDUAL_USER_REGISTER_VIEW: {
        path: "/individual-user/register",
        name: "IndividualUserRegisterView",
    },
    CORPORATE_USER_REGISTER_VIEW: {
        path: "/corporate-user/register",
        name: "CorporateResisterView",
    },
};
